exports.getProducts = (shop) => {
    return new Promise(async(resolve, reject) => {
        const url = 'https://' + shop + '/admin/api/2021-01/products.json'
        try {
            const products = await getProducts(shop, url)
            return resolve(products)
        } catch (error) {
            return reject(error)
        }
    })
}
